import "antd/dist/antd.css";
import PropTypes from "prop-types";
import React from "react";

// appjs 는 pages들의 공통 부분

const App = ({ Component }) => {
    return (
        <>
            <Component />
        </>
    )
}

App.propTypes = {
    Component: PropTypes.elementType.isRequired,
}
export default App;
